    <h1>Jaipur</h1>
    <p>Jaipur is called the Pink City of India.</p>
    <p>It is famous for Hawa Mahal, City Palace, and Amer Fort.</p>
    <p>Jaipur is also known for its delicious Rajasthani food and colorful markets.</p>
